def get_page_links(wikitext):
    """
    Get a list of all Wikipedia pages linked to from some wikitext

    Paremeters:
        wikitext: a string with some wikitext

    Returns:
        a list of the titles of all Wikipedia pages that are linked to
        from the provided wikitext
    """
    list_of_linked_pages = []
    i = 0
    while i < len(wikitext):
        # is this the start of a wiki link?
        if wikitext[i:i+2] == "[[":

            i = i+2
            linked_page_name = ""  # accumulator string

            # keep adding on to the accumulator string until we see a
            # | or ] which will indicate we've reached the end of the
            # linked page's name
            while wikitext[i] != '|' and wikitext[i] != ']':
                linked_page_name += wikitext[i]
                i += 1

            list_of_linked_pages.append(linked_page_name)

        # move on to the next character
        else:
            i += 1
    return list_of_linked_pages


def request_wiki_page_results(wiki_key):
    url = "https://en.wikipedia.org/w/rest.php/v1/page/" + wiki_key
    response = requests.get(url)
    return response.json()


def explore_wiki(wiki_title, num_pages_requested):
    q_to_explore = Queue()  # 1. initialize an empty queue for keeping track of page titles that you haven't yet explored
    set_explored = set() # 2. initialize an empty set [Note 2] for keeping track of page titles that you have already explored

    q_to_explore.enqueue(wiki_title)  # 3. Enqueue the starting page

    while len(set_explored) < num_pages_requested: # 4. While you haven't yet explored enough pages
        cur_page_title = q_to_explore.dequeue()  # Dequeue the next page to explore
        cur_page_results = request_wiki_page_results(cur_page_title) # Explore it by requesting the page from the Wikipedia API

        if "source" in cur_page_results and cur_page_results["title"] not in set_explored: # Check if the request worked [Note 3]. If it did and you haven't already explored this page, then...
            set_explored.add(cur_page_results["title"]) # add the current page to your set of explored pages


            all_links = get_page_links(cur_page_results["source"]) #
            # test
            # print("> %-4d|%4d links | %s " % (len(set_explored), len(all_links), cur_page_results["key"]))  # , end="\r")

            for i in range(10):
                if i < len(all_links):
                    q_to_explore.enqueue(all_links[i]) # retrieve the first 10 outgoing links from the current page <a href="#footnote4">[Note 4]</a> and enqueue them so you can open and explore it on some future iteration of the loop
